import TitleBar from './components/titleBar';
import Status from './components/status';
import CardProjects from './components/cardProjects';
import BaseBoard from './components/baseBoard';

function App() {
  return (
    <main className='main'>

    <TitleBar />

    <Status />

    <CardProjects/>

   <BaseBoard />
    </main>

  );
}

export default App;
